export const StyleProvider = ({ children }) => {
  const [currentMode, setCurrentMode] = useState();
  return (
    <LangContext.Provider value={{ currentMode, setCurrentMode }}>
      {children}
    </LangContext.Provider>
  );
};

export const use = () => {
